import React from 'react';
import styled from 'styled-components';

import Header from '../styles/Header';
import NavBar from '../components/NavBar';

const Index = () => {
  return (
    <div>
      <Header />
      <NavBar />
      <div>
        <Link href="/HopSelection">
          <a>Get Started!</a>
        </Link>
      </div>
    </div>
  );
};

export default Index;
